    return(
        <footer className="bg-tertiary py-12"> 
            <div className="container mx-auto">
                <div className="flex flex-col lg:flex-row space-y-6 lg:space-y-0 items-center justify-between">
                    {/*  */}
                </div>
            </div>
        </footer>
    );
}

export default Footer;
